import { jsx } from "theme-ui";
import { ThemeProvider } from "theme-ui";
import theme from "../src/styles/theme";
import Nav from "../src/components/nav";

export default function App({ Component, pageProps }) {
  return (
    <ThemeProvider theme={theme}>
      <div>
        <Nav />
        <Component {...pageProps} />
      </div>
    </ThemeProvider>
  );
}
